import React, { Component } from "react";
import "../App.css";

class Home extends Component {
    constructor() {
        super();
        this.state = {
        blogs: []
        };
    }

    render() {
        return (
        <div className="Home">
            <p>Home</p>
        </div>
        );
    }
}
export default Home;
